  false,\n\t\"url\": null,\n\t\"notes\": \"Oxygen (average seabed consumption) data
  were collected using pressure gauge from March 11, 1973 to July 1, 1973. Data were
  submitted by Scripps Institution of Oceanography in part of the International Decade
  of Ocean Exploration / Mid-Ocean Dynamics Experiment (IDOE/MODE).nnThe goal was
  to measure variations in the pressure differences between stations, for comparison
  with corresponding variations in currents. Study was conducted as part of the MODE/IDOE
  Bottom Experiment. Bottom Moored Pressure sea floor capsule data was collected on
  the NW Atlantic by the Institute of Geophysics and Planetary Physics. Data was submitted
  by Bernard D. Zetler. A paper on mode bottom experiment is included.\",\n\t\"license_title\":
